    <p>Jaya Olshop Menyediakan Semua kebutuhan yang anda perlukan silahkan cek barang yang anda inginkan di bawah ini </p>
   <ul>
 <li><a href="/proyek/Galeriproduk">Galeri Produk</a></li>
 </ul>
    <hr />
    <Menu />
    </Layout>
   )
   export default Profile;
